import React,{useState, useEffect} from 'react';
import './App.css';
import Cards from './Cards'
import axios from 'axios'

function App() {
  const [data,setData]=useState()
  useEffect(() =>{
    axios.get('http://localhost:5000')
    .then(res => {
    console.log(res)
    const sqldata = res.data
    setData(sqldata) 
  },[])

})

  return (
    <div className="App">
      <Cards data={data}/>
      {/* {data} */}
    </div>
  );
}

export default App;
